" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Lipodermatosclerosis in chronic stasis dermatitis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 378px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Chronic stasis dermatitis with signs of lipodermatosclerosis.",
"    <div class=\"footnotes\">",
